import styled from "styled-components"
const TableContainer = styled.tbody`
  padding: 20px;
`;


const Tr = styled.tr`
  background: #f9f9f9;

  &:nth-child(even) {
    background: pink;
  }`
    ;


const Td = styled.td`
  padding: 10px;
  border: 2px solid black;
`;

function Table({data}) {

    return (
        <TableContainer>
            <>
                {data.map((item, index) =>
                    <Tr key={index} >
                        <Td >
                            {item.cs_score}

                        </Td>
                    </Tr>


            )}
            </>
        </TableContainer>









    )
}
export default Table;
